import React from 'react';
import { useNavigate } from 'react-router-dom';
import './MealListPage.css'; // We'll create this CSS file

function MealListPage() {
  const navigate = useNavigate();

  const handleRateMeal = (mealName) => {
    navigate('/rate-meal', { state: { mealName } });
    console.log(`Rating initiated for: ${mealName}`);
  };

  return (
    <div>
      <img
        src="/cooklogo.png"
        alt="COOK Meals Logo"
        style={{
          maxWidth: '200px',
          height: 'auto',
          marginBottom: '20px', /* Matching the other pages */
          display: 'block',
          margin: '0 auto',
        }}
      />
      <h1 style={{ textAlign: 'center'}}>Our Delicious Chicken Meals</h1>
      
    </div>
  );
}

export default MealListPage;
